import ChatBot from "react-simple-chatbot";
import "./Chat.css";

function Chat() {
  return (
    <ChatBot
      headerTitle={"Conversa com DermaBot"}
      steps={[
        {
          id: "greeting",
          message: "Oi, sou a DermaBot!",
          trigger: "skin-type",
        },
        {
          id: "skin-type",
          message:
            "Voce diria que tem a pele seca ou oleosa?",
          trigger: "dry-or-oily",
        },
        {
          id: "dry-or-oily",
          options: [
            {
              value: 1,
              label: "Tenho a pele oleosa",
              trigger: "oily",
            },
            {
              value: 2,
              label: "Minha pele é seca",
              trigger: "dry",
            },
          ],
        },
        {
          id: "oleosa",
          message: "Ecaa, cebosa!",
          trigger: "end",
        },
      ]}
    />
  );
}

export default Chat;
